import React from 'react'

export default function LifeAria() {
    return (
        <div>
            <h3 className="card-title costome-color mt-4 mb-3 text-start">Reignite Your Life</h3>
                                 <h5 className="text-start">
                                 A Live Group Coaching Experience to Catapult You Closer to Your Dreams
                                 </h5>
                                 <p className="card-text  mt-3 text-start">I’m currently looking for individuals who are ready to take big action to make their lives BETTER. Like, “I never knew life could be this amazing!” levels of better. If you dream of achieving a big goal before the end of the year – but have been finding it hard to maintain the motivation, focus, and unstoppable mindset you need to make it happen – we would love to have you join us in our 4-month live group coaching program.</p>
        </div>
    )
}
